import React from 'react'
import styled from 'styled-components'
import {SideBarStyled} from '../sidebar'
const InfoBarStyled = styled(SideBarStyled)`
    width : 225px;

`
//height : 595px
//width : 225px 
// margin-left : 1128px
export  function InfoSideBar() {
    return (
        <div>
            <InfoBarStyled>
            This is side bar
            </InfoBarStyled>
        </div>
    )
}
